import React from 'react';
import SideBarRow from './SideBarRow/SideBarRow';
import './SideBar.scss';

export default function SideBar(){
    return (
        <div className = "SideBar">
            <SideBarRow src = "#" title = "Ossama Elidrissi"/>
            <SideBarRow title = "Friends"/>
        </div>
    );
}
